import React, { Component } from "react";
import Slider from "react-slick";

const SlickCard = () => {
  const settings = {
    customPaging: function (i) {
      return (
        <a>
          <img
            style={{ width: "70px" }}
            src={`http://localhost:5000/uploads/2022-01-11T23:55:15.128Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg`}
          />
        </a>
      );
    },
    dots: true,
    dotsClass: "slick-dots slick-thumb",
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <div>
      <h2>Custom Paging</h2>
      <Slider {...settings}>
        <div>
          <img
            src={
              "http://localhost:5000/uploads/2022-01-11T23:55:15.128Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg"
            }
            alt="img"
          />
        </div>
        <div>
          <img
            src={
              "http://localhost:5000/uploads/2022-01-11T23:55:15.128Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg"
            }
            alt="img"
          />
        </div>
        <div>
          <img
            src={
              "http://localhost:5000/uploads/2022-01-11T23:55:15.128Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg"
            }
            alt="img"
          />
        </div>
        <div>
          <img
            src={
              "http://localhost:5000/uploads/2022-01-11T23:55:15.128Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg"
            }
            alt="img"
          />
        </div>
      </Slider>
    </div>
  );
};

export default SlickCard;
